import React from 'react';
import './index.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import VehicleOptions from './components/VehicleOptions';
import OrderForm from './components/OrderForm';
import ShoppingCart from './components/ShoppingCart';
import HomePage from './components/home-page';
import CataloguePage from './components/catalogue-components';
import AppLayout from './components/app-layout';
import AdminDashboard from './components/admin-dashboard';
import { LoginPage, ProfilePage } from './components/auth-profile';
import ClientManagement from './components/client-management';
import OrderManagement from './components/order-management';
import shadcnComponents from './components/ui';
import VehicleForm from './components/vehicle-form';
import { authService } from '../services/authService'
import PrivateRoute from './components/PrivateRoute';
import DocumentCartManager from './components/document-cart-manager';


function App() {
  return (
    <Router>
      <div>
        {/* Utilisez React Router pour afficher les composants en fonction de la route */}
        <Routes><Route
            path="/"
            element={
              <PrivateRoute>
                <Dashboard />
              </PrivateRoute>
            }
          />
          <Route path="/" element={<HomePage />} />
          <Route path="/vehicle-options" element={<VehicleOptions />} />
          <Route path="/order" element={<OrderForm />} />
          <Route path="/cart" element={<ShoppingCart />} />
          <Route path="/catalogue" element={<CataloguePage />} />
          <Route path="/admin-dashboard" element={<AdminDashboard />} />
          <Route path="/login" component={LoginPage} />
          <Route path="/profile" component={ProfilePage} />
          <Route path="/client-management" component={ClientManagement} />
          <Route path="/order-management" component={OrderManagement} />
          <Route path="/vehicule-form" component={VehicleForm} />
          <Route path='/ui' component={shadcnComponents} />
          <Route path='/document' component={ DocumentCartManager

          } />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
